import Container from '../../UI/container'
import QuoteItem from './QuoteItem'

import styles from './Quote'

const QuoteList = (props) => {
    const data = props.quoteData
    
    return(
        <Container>
            <ul >
                {data.map((item => {
                   return <QuoteItem quote={item} key={item.id}/>
                }))}
            </ul>
        </Container>
    )
}

export default QuoteList
